   useEffect(()=>{
      if (localStorage.getItem("login") === "hello") {
        setUser("sdgsg");
      }
    })
    console.log(user)
    if (user)return <Navigate to='/dashboard'></Navigate>;
    return children;
 }

 export default ProtectedRoute
